- name: libzip-rel-1-5-2/lib/zipconf.h
  resolver:
    name: script
    config:
      script: |
        echo "// This file was generated by libzip.yml."
        echo
        echo "#define LIBZIP_VERSION \"1.5.2\""
        echo
        echo "#include <stdint.h>"
        echo
        echo "typedef int8_t zip_int8_t;"
        echo "typedef uint8_t zip_uint8_t;"
        echo "typedef int16_t zip_int16_t;"
        echo "typedef uint16_t zip_uint16_t;"
        echo "typedef int32_t zip_int32_t;"
        echo "typedef uint32_t zip_uint32_t;"
        echo "typedef int64_t zip_int64_t;"
        echo "typedef uint64_t zip_uint64_t;"
        echo
        echo "#define ZIP_INT8_MIN (-ZIP_INT8_MAX - 1)"
        echo "#define ZIP_INT8_MAX 0x7f"
        echo "#define ZIP_UINT8_MAX 0xff"
        echo "#define ZIP_INT16_MIN (-ZIP_INT16_MAX - 1)"
        echo "#define ZIP_INT16_MAX 0x7fff"
        echo "#define ZIP_UINT16_MAX 0xffff"
        echo "#define ZIP_INT32_MIN (-ZIP_INT32_MAX - 1L)"
        echo "#define ZIP_INT32_MAX 0x7fffffffL"
        echo "#define ZIP_UINT32_MAX 0xffffffffLU"
        echo "#define ZIP_INT64_MIN (-ZIP_INT64_MAX - 1LL)"
        echo "#define ZIP_INT64_MAX 0x7fffffffffffffffLL"
        echo "#define ZIP_UINT64_MAX 0xffffffffffffffffULL"
        echo
        echo "// Extreme hacks start here!"
        echo "#define SIZEOF_OFF_T 8"
        echo "#define HAVE_FSEEKO"
        echo "#define HAVE_FTELLO"
        echo "#define HAVE_MKSTEMP"
